import { RiTeamFill } from "react-icons/ri";
export const SidebarData = [
  {
    title: "漢字庫",
    path: "/",
    icon: <RiTeamFill  />,
    cName: "nav-text"
  },
  {
    title: "關於",
    path: "/about",
    icon: <AiIcons.AiFillHome />,
    cName: "nav-text"
  },
  {
    title: "幫助中心",
    path: "/support",
    icon: <IoIcons.IoMdHelpCircle />,
    cName: "nav-text"
  }
];
